import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const { colors } = theme.palette;
  return {
    svgIcon: {
      fill: colors.main50,
      marginBottom: 10,
      fontSize: "18px",
      "&:hover": {
        fill: colors.secondary,
        cursor: "pointer"
      }
    },
    socialLinks: {
      display: "flex",
      flexDirection: "column",
      position: "absolute",
      bottom: 0,
      left: 20
    },
    line: {
      height: "100px",
      border: "10px solid white"
    }
  };
});
